import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';

const Main = () => {
  const navigate = useNavigate();
  return (
    <>
      <button onClick={navigate('/ds')}>ds</button>
    </>
  )
}

export default Main
